import { Route, Routes, BrowserRouter, Link} from "react-router-dom";
import TopRated from "./TopRated"
import HomePage from "./HomePage"


function App() {
    return (
        <>
        <Routes>
            <Route path="/toprated" element={<TopRated/>} />
            <Route path="/" element={<HomePage/>} />
        </Routes>
        {/* <Header/>
        <MovieSlider/> */}
        </>
    )
}
export default App;
